/*!
 * Built with Duet Design System
 */
import { formatViolations, options as axeRunOptions, testWithAxe } from "../../utils/axe-core-utils";
describe("[a11y] duet-footer", () => {
    it("should render an accessible component", async () => {
        const result = await testWithAxe(`
        <duet-footer logo-href="/" language="fi" class="duet-example-without-padding"> </duet-footer>

        <script>
          var footer = document.querySelector("duet-footer")
          footer.menu = [
            { label: "Turvallisuus ja käyttöehdot", href: "#" },
            { label: "Evästeet", href: "#" },
            { label: "Henkilötietojen käsittely", href: "#" },
          ]
        </script>
      `, axeRunOptions);
        expect(result).not.toBeNull();
        expect(formatViolations(result.violations)).toEqual([]);
    });
});
